<template><div></div></template><script>export default {  beforeMount() {    const todayDate = new Date();    const result = this.$store.getters['getThisWeekId'];    const id = this.$store.getters.user.partner_id;    this.$router.push({      name: 'crucialInfo04',      params: {        weekId: todayDate.getFullYear() + '-' + result,        type: 'employee',        id: id,      },    });  },};</script>